/*Table structure for table `diary` */

DROP TABLE IF EXISTS `diary`;

CREATE TABLE `diary` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` varchar(36) NOT NULL,
  `title` varchar(20) NOT NULL,
  `content` varchar(1000) NOT NULL,
  `datetime` varchar(20) NOT NULL,
  `userId` varchar(36) NOT NULL,
  `username` varchar(10) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8;

/*Data for the table `diary` */

insert  into `diary`(`id`,`uid`,`title`,`content`,`datetime`,`userId`,`username`) values (1,'027ec197-8b88-4262-b2f4-5a691b139c01','测试',' 今天第一天开始试用。','2010-9-18 16:17:41','20c15fa6-0078-481b-8c76-d7ac1b45fc8e','admin'),(2,'2c73e309-72e6-4b68-ad5a-6af31afdaca4','过完十一了','	这个十一过完了，十一送她们母女两个回娘家了。\n	今天节后第一天上班，真的感觉很不顺心。','2010-10-8 20:16:34','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(3,'cdc23269-7885-4274-a592-044e01ab2e02','子涵叫爸爸啦','	今天子涵叫爸爸啦，不停的叫，在电话里面听到她叫我，真想抱抱她，亲亲她啦。\n	今天真是高兴，子涵终于要学会叫爸爸啦。','2010-10-20 21:05:26','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(4,'58eaee95-acfb-4ce8-bbab-e40107cb67a0','有存款了。','昨天在工商银行存下了一年的定期存款，存了9千块。','2011-2-11 22:20:45','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(5,'a41a5e44-661d-4569-bbab-9b27fd7cc036','涨工资了','今天给涨工资的邮件了。','2011-3-24 20:45:18','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(6,'bfa1000c-7d92-46a8-8fd2-31be148aac73','花销预算','      房租 1200\n     水电费 200\n 老公交通费  88（4元*22天）\n 老公午餐费 440（20元*22天）\n 老公电话费   0\n 老公剪头费  10\n 老公服装费 100\n 紫涵奶粉钱 318（53元/5天*30天）\n 紫涵纸尿裤  60（2元*30天）\n 紫涵订酸奶  75（2.5元*30天）\n 紫涵零花钱 200\n    生活费 1324（4000元-2676元）\n   总合计  4000元','2011-3-26 11:19:51','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(7,'ec377da9-7508-4b35-9c3a-79323e129605','子涵可以自己走了','	子涵可以自己走了，就是胆子有点小，不敢迈步。现在她高兴的时候可以自己往前迈几步了。','2011-6-24 22:36:06','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(8,'b1951bd4-ad63-47ff-a649-cacf2fb759f5','子涵可算是会走了','	子涵今天可是第一次开始迈步了，盼望很久的走了算是初步会了。\n	今天早上，教她走路，终于第一次迈开步子了，走的虽然还不是很稳当，可已经是一个很好的开始了。\n高兴的培挨个给打电话通知啊。','2011-6-25 21:54:11','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(9,'af8b4a27-06a1-46b1-b6c1-acba743bfea2','子涵今天走的挺稳当了','	今天下班了看到子涵在楼下玩，走的可稳当了。和其他小朋友一起玩，她玩的很高兴。\n又跑又笑的，转身走，小步跑，都会了。','2011-6-27 21:25:24','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(10,'a2b87333-a3f3-4407-8a55-fe08b258eee1','摸罗锅','	昨天晚上带子涵一起去小树林摸罗锅，总共摸了三个。','2011-7-4 21:12:47','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(11,'485c25a1-da92-43ae-acc0-316de8b1a57b','明天给子涵打针去','	培明天要带子涵去打针。第一次去，我也不和她一起去了，还不知道怎么样呢。','2011-7-5 22:10:06','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(12,'cb38461e-7520-4967-9dd9-d3188d8bdf83','子涵打了两天针了','子涵从昨天开始打针的，拿了三天的药就花了快500了，要连续打十天的。\n明天妈妈要来了，培一个人实在是看不了她了。','2011-7-8 22:46:58','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(13,'452b3064-17ad-4872-8966-08371d6afada','子涵奶奶来了','	昨天接到子涵奶奶了，培一个人看子涵太难了，让我妈来给帮帮忙。','2011-7-10 17:17:41','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(14,'3ae7a93e-198e-4685-b0d8-b16fd58f5fc3','子涵病了','昨天，子涵发烧了，烧到39度了，去了两趟医院，晚上还折腾了一晚上。','2011-7-15 21:13:54','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(15,'b170255b-b3c3-42af-8ec7-eebeadc5b04e','又给子涵剃光头了','昨天又给子涵剃了个光头，这是今年第二次剃了。','2011-8-13 16:13:40','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(16,'12b43cee-6348-46f2-b07b-96476dccd229','子涵两岁了','子涵今天过生日，明天周一，要上班，就今天提前给她过了。给她做碗面条吃吧。','2011-8-21 12:47:26','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(17,'5b20886c-9e43-4a73-a767-daa3bb332341','明天培要带子涵回邯郸了','明天培要带子涵回邯郸了，带她回去做康复训练，预计回去两个月，在十月底回来。','2011-8-30 21:04:51','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(18,'2d56864f-1232-4cd2-b817-81192d0e9ba1','子涵会蹲了','子涵终于学会蹲了，现在她拉粑粑的时候都自己蹲下，一发现她蹲着不起了，肯定是要拉了。','2011-9-24 15:49:05','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(19,'9aeb341e-2120-4126-9a95-35be947d835f','妈回去了','妈今天回去了，回去看牙去，刚好子涵也不用看病了，培一个人也能看她了。\n分两次给了妈点钱，先给了200，后来又给了450，感觉挺亏欠爸妈的。','2011-11-6 17:52:42','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(20,'09b3a3ea-40b2-4982-811a-4f9fec393a5e','要提离职申请了','明天去了就提离职申请，从无限讯奇离职了。','2011-11-15 20:42:30','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(21,'865071d1-79c5-4ace-8fa4-ec1aa372adb4','今天给子涵做了个DNA检测','今天给子涵做了个DNA检测，检查一下是不是基因的问题，子涵现在可是我很大的心病啊。','2011-11-24 21:00:52','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(22,'43631c1e-6be7-42c1-863e-2732d1e2e2f3','从讯奇离职办完了','今天讯奇的离职办完了，从10年3月8日到今天，在讯奇上班两年了啊。','2011-12-16 20:57:16','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(23,'8072592d-3952-4466-be53-fd6ce5e0dbd3','今天给子涵看医生了','今天跑了三个地方，第一个地方是安贞附近的一个幼儿园，因为今天是周末，没能进去。\n第二个是东城区的一个孤独症治疗中心，今天有人，咨询了一下他们那里的治疗情况。\n第三个是在朝阳区，特别远，坐八通线，再倒车才到，结果去了也没人。','2011-12-17 20:51:25','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(24,'4917279b-e565-4f79-b49a-de003cd5b796','协和方通',' 从22号开始给孩子做治疗以来，每天晚上都睡不好觉，睡眠质量极差，\n 有时候甚至睡的不到三个小时，这样让孩子怎么吃的消啊。\n22号四点，24号四点，26号一点，本来约的今天上午十点半的，我不想让孩子去了。\n昨晚又是一宿没睡，如果可以，明天再去。\n 说到孩子的进步，我觉得还是有的，就是不知道是治疗的作用还是孩子自己发展的\n结果。\n首先是他知道害怕了，抱着她颠的时候他知道抱着你的脖子，怕摔。\n在华联里玩的时候也进步了很多，好多一起拿不敢玩的都会了，尽管还有好多他不知道\n怎么玩。\n昨天让他拿着涂鸦板，他知道自己拿着画了，虽然画的很没有规矩，但不是总想着吃了，\n偶尔还是放到嘴里品尝一下什么味道。\n不知道怎么回事，最近总尿裤子，是大人照顾不周吗？还是他的退步？也学会站着拉屎\n了，很让我头疼，希望这个毛病尽快纠正过来。\n\n\n\n','2011-12-28 8:06:26','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(25,'b9d47cad-59f8-4646-9630-75b953d211a4','协和方通',' 昨天是做治疗的第六次了，不见什么效果，又是哭了40来分钟，可能是时间太短的\n原因吧，这个病也不是急的来的。不过最近几天。子涵的睡眠质量稍微转好了些，\n我不知道是治疗起作用了，还是因为我的原因。\n自从张鹤过来以后，给我提了些建议，我妈也劝我，不管孩子怎么样，都是我们\n自己生的，一定要对他好些，一定要有耐心，只有耐心安抚她，他才会有进步，我按他\n说的方法，试了好几天了，真的见效，子涵真的不再那么哭闹了，我也从心里不再那么\n急躁了。着急也没用。','2012-1-2 9:33:28','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(26,'fb7c2278-0724-4cd7-a6c6-c05f9397cfa8','离婚','','2013-12-28 13:42:54','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(27,'6f174de6-80ef-4b65-ba66-4ed3c492adf4','子涵大病了一场','子涵从大年三十病了，到现在还没完全好呢。今年没回家，在北京过的，但是这个年过的也不是怎么顺心啊。','2012-1-26 18:05:13','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(28,'85bcf144-9a8f-4943-a6d0-f2b6223ec2bc','今天给子涵检查了听力','	今天给子涵检查了一下听力，结果是听力没任何问题。不管怎么说听力方面是不用再担心什么了，也算是除去了一个心病吧。','2012-2-22 21:13:23','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(29,'d62bd360-7009-45c5-ab01-a4a4f094e964','追悔自己的冲动，鲁莽','','2013-12-28 13:44:11','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(30,'d4f9b1af-b0b1-4b40-8803-db8db0fc15d3','说些高兴的事','  真的是一恍，我去达内培训已经将近三个月了，还有一个多月就要开始找工作了。每天都觉得过得太快了，感觉时间总不够去做练习。第一个实训项目基本上就算是做完了，可是，我基本上什么都没有做出来，我最大的收获就是，把思路整理清楚一些了，虽然我做不出来，但是觉得不是那么那么茫然了，剩下的时间就是要多多练习了。我的压力也是很大的，我不能给老公丢人啊，老公每天都可以辅导我，我最后学的什么都不是，怎么交差啊，对的起谁啊？好好练习吧，努力一个半月，前途会很光明的。\n\n说说子涵吧，最近跟子涵接触的很少，因为每天去上课，回来已经很晚了，他一般玩不了多一会，就该睡觉了。多亏了婆婆和我妈妈他们精心照顾子涵，才能让我安心学习。最后要是真的找不到工作，我怎么对的起他们啊。哎。。。。。\n 子涵最近进步不小，各个方面都有，睡觉是最明显的。他的眼神，也跟以前不太一样。尤其是你跟他说话的是时候，他似乎什么都能听懂。看看吧，子涵到三周岁的时候就能上幼儿园了，还有半年的时间，希望他的进步能再大一些。早日赶上同龄的孩子。','2012-3-17 21:45:39','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(31,'57d7ec6c-7ae9-4014-9bdc-a39ed7ffc4a3','第一次面试',' 今天算是我的第一次面试吧，感觉不是特别的理想，没有感觉到面试的气氛，就像跟一个陌生人聊天一样，很随意。随便说了些什么。我觉得自己根本不知道该问面试官什么问题，更多的是我是被动的回答问题。我不知道该从面试官嘴里了解公司的什么。可能跟没有做准备有关系吧。\n 下周二就要陆续的开始面试了，每天都有面试的单位，一直到26号毕业。我怎么才能让自己通过面试这一关呢，进入到一个大公司呢？不想进小的公司。可是我的动手能力确实很差，似乎我还没有写过一个像样的程序出来呢。我练习的太少了，这会不会是我面试的一个障碍呢？\n 好好准备，准备迎接一轮轮的面试吧。','2012-4-11 22:56:48','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(32,'b12c15fc-73a4-4836-bb98-60bb780c6c75','模拟面试',' 上周五下午进行了一场模拟面试，是关于技术方面的。我很紧张，不知道该说些什么。自己学过的东西整理不出来。都是一些零碎的小知识点，没有一个整体的把握。自我介绍方面，不知道怎么把自己的优势展示给面试官，怎么把劣势避开。\n 这只是一个小的模拟面试，不知道真正面对面试官的时候我是个什么表现。自我介绍方面我不太发愁，因为是跟面试官的对话方式，可以让我放松。可是专业技术方面呢？我对自己很不自信，我学的一般，不是特别的好，主要的原因是我练习的太少了，学编程，不写代码怎么可能学好呢？所以我最怕面试官的提问。我怕提问到我不会的知识，我没有随机应变的能力去换着角度去回答。前边学的知识现在也忘的差不多了，脑子里只有最近学的zend框架，smarty模板，越往前边的知识忘的越多。','2012-4-16 15:15:44','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(33,'84933f59-0ff5-4a20-b1b7-646d54437150','2012-08-15','  从这一天起，我又辞职做了全职妈妈。不知道是好事还是坏事？与原来的全职妈妈相比，我对子涵的态度，已经有了很大的变化。原来是不肯承认他的问题，到现在的可以坦然接受，并且可以积极的配合康复治疗。对他的未来也是充满了希望。\n  ','2012-8-18 23:05:15','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(34,'a37cfaae-5977-4bd2-9544-fc32fce1c683','花销预算','  隔了大概有半年，我又要做预算了。准备明年年底买房子，从现在开始就要攒钱了。我没有了工作，在家全职带子涵做康复训练。老公的压力很大的。我能做的也就是把家里的各项开支安排好。尽可能多的攒些钱出来。大概估算一下吧。\n  子涵康复训练费：2800\n  房  租  开  销：3150\n  房  租  收  入：2500-150-1800=550\n  水          费：16\n  电          费：50\n  通    讯    费：100\n  公    交    卡：100\n  生活费+杂花+服装费：1000\n  合计花销：6672\n  每个月必须固定存4000，\n  9月，10月，11月，12月，1月，2月，3月，4月，5月，6月，10个月40000\n  7月，8月，9月，10月，11月，12月 6个月24000\n空\n\n\n\n\n\n\n\n\n\n','2012-8-21 8:21:33','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(35,'1f8f000b-d4b2-491b-8fe0-265160880910','明年可以买房子了','  明年年底我们也可以买房子了，自己省吃俭用一年也要先把房子买了。一定要买','2012-8-21 8:23:52','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(36,'af214dee-37cc-414f-b1de-2eb5d4a53c03','8月20号','  从8月20号开始，我妈他们去张鹤那玩了，之后好像是说去保定，再后边不知道什么时候可能是需要我们送他们会邯郸。反正是，我妈一天也不想给我看孩子了，回顾他给我 看孩子的这半年，每到周末就开溜，不让走还不高兴。走了就不想回来，知道周一早上。我也是这样被试用期辞职的。不能说跟这个没有半点关系吧？自己的妈跟婆婆有什么区别呢？甚至还不如婆婆知道心疼我。当然大事上或许还是自己的妈疼自己，但是生活中大多数还是小事，哪里有那么多的大事发生啊？\n  我妈对他们偏向的不行，哪怕他们做错了，也是劝我说我不对，要不就 别跟他们一般见识。怎么 我就没有对的时候呢？他们结婚，我没有准备给他们什么？我真的不想给，从内心觉得他们对不起我。他们心里没有我，我为什么要给他们呢？？\n  ','2012-8-21 14:01:32','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(37,'ac8bfc11-61a5-4a30-b3ff-6443d26f3b6d','有种犯罪的感觉 ','  总觉得时间很紧张，时间安排不开，一天的时间一晃就过去了。怎么能最大程度的利用好子涵醒着的这几个小时啊？\n  觉得自己在浪费时间，自己的思想的一秒钟开岔，都觉得是一种犯罪。我不能把子涵的时间耽误了。现在是他最好的康复机会，不能就这样一天天晃过去。\n  ','2012-8-23 13:30:03','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(38,'1ef6dab2-c835-4c9e-8e94-4693033ad9f0','搬家回来了','今天下了今年的第一场雪，特别大，一号搬回来的，多亏了搬得早了两天，不然就没法搬家了。搬到双井住了四个月，这一趟折腾消耗进去一万多吧。','2012-11-4 22:12:28','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(39,'cf4db20e-e791-48d0-920f-45005d7a8db6','贷款放款了','	24号贷款放款的，估计下个月24号就要开始还贷了。','2013-9-25 23:00:38','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong'),(40,'7d26c8a5-fdfb-4087-9cbd-80777f2a5f3c','妈今天坐手术了','  妈今天在石家庄做股骨头置换手术了。','2013-12-28 18:36:15','6a8a9366-e7b2-4166-a050-ee57327d43a6','zhp'),(41,'72c8c3d6-e8c7-423c-82d1-f328ee18b868','公积金还款','	6月6号公积金终于取出来了，总计10.8万。当天还账后剩下没几个子了。还王松一万、金童一万、小姑一万、泽欣哥两万、丈母娘两万。给爸打过去了两万装修款。总共花出去了九万。当天就花完了。','2014-6-8 21:25:57','71b8d0fd-ce76-4ef9-89f3-937e807ce1a3','dyong');

